cells.account_introduction:
FashionWeek微信公众号创立于2013年3月，是都市时尚群体垂直新媒体平台，从事时尚类移动互联网广告。经过四多年的发展，现已成团队化、专业化的新媒体公司。创立以来常年入围微信新媒体500强，时尚类别前10。在内容方面专注于潮流搭配、护肤彩妆、珠宝配饰、奢侈品等时尚领域，为高端白领提供集实用性、互动性、鉴赏性为一体的女性资讯。关注热点事件，跟踪潮流趋势，传递全方位时尚休闲生活资讯。

2015年，荣获搜狐年度时尚自媒体人奖项;
2015年，荣获VIVA畅读年度十大最具潜力新媒体奖项;
2016年，荣获微播易风向大会年度最受广告主欢迎奖项;
2016年5月，荣获媒探(华南)影响力自媒体奖项;
2017年1月， 荣获微播易风向大会年度行业自媒体奖项;
